A group of criminals try to rob the circus by having a beautiful woman seduce the circus owner.They did not count on the code of the freaks, &quot;You Hurt One of Us; There's going to Be Trouble.&quot;

The best part of this movie is that it features &quot;real&quot; sideshow folks, including Larry Gomez &quot;the Mexican Wolf Boy&quot;; VeeKay, Sideshow Performer and Barker; Jimmy GoldMan, Armless Wonder; Bill Quinn, Legless Wonder, and several other oddities.



